format ELF64

section '.data' writeable

; memory layout
stack_pos dq 0
stack_end dq 0
heap_pos dq 0
heap_end dq 0

section '.text' executable

;
;
; allocator_init
;
;   INPUT: nothing
;   OUTPUT: nothing
allocator_init:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    ; allocate the stack 64K
    mov     rax, 12                    ; brk
    mov     rdi, 0                     ; increment = 0
    syscall
    mov     [stack_pos], rax           ; save the current position of the stack
    mov     [stack_end], rax           ; save the end of the stack

    mov     rax, 12                    ; brk
    mov     rdi, 0x10000               ; 64K bytes (larger obj. will fail)
    add     rdi, [stack_end]           ; new end of the stack
    syscall

    ; initialize the heap
    mov     rax, 12                    ; brk
    mov     rdi, 0                     ; increment = 0
    syscall
    mov     [heap_pos], rax            ; save the current position of the heap
    mov     [heap_end], rax            ; save the end of the heap

    pop     rbp                        ; restore return address
    ret

;
;
; stack push addr
;
;   INPUT: rdi contains the int64 (pointer) that we add to the stack
;   OUTPUT: nothing
;
stack_push_addr:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    mov     rsi, qword [stack_pos]
    mov     qword [rsi], rdi
    add     qword [stack_pos], 8

    pop     rbp                        ; restore return address
    ret

;
;
; stack push
;
;   INPUT: rdi contains the int64 (pointer) that we add to the stack
;   OUTPUT: nothing
;
stack_push:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    push    rdi
    mov     rdi, 8
    call    allocate
    pop     rdi
    mov     [rax], rdi

    mov     rsi, qword [stack_pos]
    mov     qword [rsi], rax
    add     qword [stack_pos], 8

    pop     rbp                        ; restore return address
    ret

;
;
; stack peek addr
;
;   INPUT: nothing
;   OUTPUT: rax contains the int64 (pointer) that we pop from the stack
;
stack_peek_addr:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    mov     rax, qword [stack_pos]
    mov     rax, qword [rax - 8]

    pop     rbp                        ; restore return address
    ret

;
;
; stack peek
;
;   INPUT: nothing
;   OUTPUT: rax contains the int64 (pointer) that we pop from the stack
;
stack_peek:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    mov     rax, qword [stack_pos]
    mov     rax, qword [rax - 8]
    mov     rax, qword [rax]

    pop     rbp                        ; restore return address
    ret

;
;
; stack pop addr
;
;   INPUT: nothing
;   OUTPUT: rax contains the int64 (pointer) that we pop from the stack
;
stack_pop_addr:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    mov     rax, qword [stack_pos]
    mov     rax, qword [rax - 8]
    sub     qword [stack_pos], 8

    pop     rbp                        ; restore return address
    ret

;
;
; stack pop
;
;   INPUT: nothing
;   OUTPUT: rax contains the int64 (pointer) that we pop from the stack
;
stack_pop:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    mov     rax, qword [stack_pos]
    mov     rax, qword [rax - 8]
    mov     rax, qword [rax]
    sub     qword [stack_pos], 8

    pop     rbp                        ; restore return address
    ret

;
;
; stack pick
;
;   INPUT: rdi contains the index
;   OUTPUT: rax contains the int64 (pointer) that we pick from the stack
;
stack_pick_addr:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame

    mov     rax, qword [stack_pos]
    shl     rdi, 3 ; multiply index with 8
    sub     rax, rdi ; offset stack_pos with index*8
    mov     rax, qword [rax - 8]

    pop     rbp                        ; restore return address
    ret

;
;
; allocate
;
;   INPUT: rdi contains the size in bytes
;   OUTPUT: rax points to the newly allocated memory
;
allocate:
    push    rbp                        ; save return address
    mov     rbp, rsp                   ; set up stack frame
    sub     rsp, 16                    ; allocate 2 local variables

    ; t0 <- heap_pos
    mov     rax, qword [heap_pos]
    mov     qword [rbp - loc_0], rax

    ; t1 <- t0 + rdi
    mov     rax, qword [rbp - loc_0]
    add     rax, rdi
    mov     qword [rbp - loc_1], rax

.alloc_do:
    ; cmp t1 <= heap_end
    mov     rax, qword [rbp - loc_1]
    cmp     rax, qword [heap_end]
    jle     .alloc_ok

    mov     rax, 12                    ; brk
    mov     rdi, 0x10000               ; 64K bytes (larger obj. will fail)
    add     rdi, [heap_end]            ; new end of the heap
    syscall

    mov     [heap_end], rax            ; save the new end of the heap
    jmp     .alloc_do

.alloc_ok:

    ; heap_pos <- t1
    mov     rax, qword [rbp - loc_1]
    mov     qword [heap_pos], rax

    ; return t0
    mov     rax, qword [rbp - loc_0]

    add     rsp, 16                    ; deallocate local variables
    pop     rbp                        ; restore return address
    ret

section '.data' writeable

stack_env dq 0

; Define some constants
loc_0 = 8
loc_1 = 16
loc_2 = 24
loc_3 = 32
loc_4 = 40
loc_5 = 48
loc_6 = 56
loc_7 = 64

arg_0 = 16
arg_1 = 24
arg_2 = 32
arg_3 = 40
arg_4 = 48
arg_5 = 56
arg_6 = 64
arg_7 = 72

; Define entry point
section '.text' executable
public _start
_start:
    ; Initialize the memory
    call allocator_init

    ; store argc on the stack
    mov     rdi, qword [rsp]
    call    stack_push

    ; store argv on the stack
    mov     rdi, rsp
    add     rdi, 8
    call    stack_push

    ; store env in stack_env
    mov     rax, qword [rsp]
    shl     rax, 3
    mov     rdi, rsp
    add     rdi, 8
    add     rdi, rax
    add     rdi, 8
    mov     qword [stack_env], rdi

    ; Call the main method
    call    func.0 ; main

    ; Exit the program
    call    stack_pop
    mov     rdi, rax
    mov     rax, 60
    syscall

