    mov     qword [rbp - loc_0], rax

    ; t1 <- B
    call    stack_pop_addr
    mov     qword [rbp - loc_1], rax

    ; push A
    mov     rdi, [rbp - loc_0]
    call    stack_push_addr

    ; push B
    mov     rdi, [rbp - loc_1]
